INSERT INTO `yl_articles` VALUES ('2', '汉中供电公司强化年末岁尾安全生产工作', '1', '0', '13456654', '<p></p><p></p><div><div><p>来源： 中国电力新闻网      日期：19.01.10</p></div></div><div></div><div><p>　　中国电力新闻网讯 通讯员 靳伟 报道  年末岁尾，是安全管理的关键期。1月9日，国网汉中供电公司召开安全工作会，“明责任、严落实”采取多种措施，切实抓好年末岁尾安全生产工作，严防各类事故发生，确保安全生产形势稳定。</p><p>　　一是积极开展安全生产宣传。通过横幅、标语、培训等多种形式，宣传《安全生产法》等法律法规，强化“红线意识”和底线思维，牢固树立以人为本，生命至上理念，营造“关注安全，关爱生命”的良好社会氛围。</p><p>　　二是深入开展安全隐患排查活动。巩固前期安全生产大检查成果，对辖区所有重点线路、过载变压器开展安全生产检查“回头看”活动，真正把大检查大排查工作的着力点和突破口放在基层一线，及时排查发现安全隐患和问题，着力促进整改，确保企业生产安全。</p><p>　　三是加大重点领域安全监管。进一步加大对辖区车站、商场、景区等人员密集场所等行业领域的检查力度，对专变容量在315kVA以上的线路设备开展专项检查。指导和督促用户加强设备的运行管理和维护，及时发现和消除各类安全隐患。</p><p>　　四是强化部门监管责任。严格落实“党政同责、一岗双责、齐抓共管、失职追责”责任制和“三个必须”要求，强化部门监管职责，扎实开展安全专项检查，联合督查，形成层层抓促安全生产的联动机制，有效抓促年末岁尾安全生产各项工作。</p><p align=\"center\"><font face=\"Arial\" deep=\"17\"><font deep=\"19\"><a href=\"http://www.cpnn.com.cn/cpnn_zt/40zn/\" _fcksavedurl=\"http://www.cpnn.com.cn/cpnn_zt/40zn/\"><img src=\"http://www.cpnn.com.cn/tsgl/201809/W020180928538522285792.jpg\" _fcksavedurl=\"http://www.cpnn.com.cn/tsgl/201809/W020180928538522285792.jpg\" data-bd-imgshare-binded=\"1\" oldsrc=\"W020180928538522285792.jpg\"></a></font></font></p><p align=\"center\"><span deep=\"7\"><span deep=\"8\"><span deep=\"9\"><span deep=\"10\"><span deep=\"11\"><span deep=\"12\"><span deep=\"13\"><span deep=\"14\"><span deep=\"15\"><span deep=\"16\" _fckxhtmljob=\"1\"><font face=\"Arial\" deep=\"17\"><span deep=\"18\"><font deep=\"19\">责任编辑：周小博　</font></span> <span _fckxhtmljob=\"1\">投稿邮箱：</span><span _fckxhtmljob=\"1\"><span _fckxhtmljob=\"1\"><span _fckxhtmljob=\"1\"><font color=\"#2c2c2c\" _fckxhtmljob=\"1\">网上投稿</font></span></span></span></font></span></span></span></span></span></span></span></span></span></span></p></div><p><br></p>', 'files/fff.pdf', 'images/edd63eda1b4ed3136208ee362a797087.jpg', '100', '1', '2019-01-11 11:21:35', '2019-01-11 11:57:52');
INSERT INTO `yl_articles` VALUES ('3', '公司简介', '8', '0', '重庆悦灵安全技术服务有限公司为镇海石化建安工程有限公司投资设立的有限责任公司，是一家集企业安全技术服务、安全咨询、安全监察、安全检验检测、安全评价、工程施工监理于一体，拥有专业安全技术、高层次人才和先进安全设备，面向国内市场提供安全技术和管理服务的新型企业。', '<p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\" class=\"\"><br></p><p>　　重庆悦灵安全技术服务有限公司为镇海石化建安工程有限公司投资设立的有限责任公司，是一家集企业安全技术服务、安全咨询、安全监察、安全检验检测、安全评价、工程施工监理于一体，拥有专业安全技术、高层次人才和先进安全设备，面向国内市场提供安全技术和管理服务的新型企业。</p><p><br></p>', '', '', '100', '1', '2019-01-11 13:44:14', '2019-01-11 13:44:14');
INSERT INTO `yl_articles` VALUES ('4', '联系我们', '10', '0', null, '<p></p><p></p><p></p><p></p><p>重庆悦灵安全技术服务有限公司\r\n\r\n　　</p><p>地址：重庆市渝北区广告产业园\r\n\r\n　　</p><p>业务联系电话：0574-133-456\r\n\r\n　　</p><p>值班电话：123-321-654\r\n\r\n　　</p><p>QQ：第三方技术服务666666</p><p><br></p>', '', '', '100', '1', '2019-01-11 14:46:06', '2019-01-11 16:32:58');
INSERT INTO `yl_articles` VALUES ('5', '2018春节放假通知', '2', '0', null, '<p></p><p>集团所属各公司部门：</p><p>　　根据国务院办公厅关于20XX年春节放假安排，结合公司实际情况，为了让公司的员工共同度过一个欢乐、平安的新春佳节，现将20XX年春节放假事宜通知如下：</p><p>　　一、放假时间：自20XX年2月10日（农历腊月二十五）至20XX年2月21日（正月初六）放假，共12天。20XX年2月22日（正月初七）正常上班。</p><p>　　二、调班：2月24日（周六）调班一天，正常上班。</p><p>　　三、2月15日（除夕）－21日（正月初六）7天为带薪假期（国家法定假期）；2月11日－14日为无薪假期。</p><p>　　四、各部门须认真做好安全检查工作。对所属办公室进行以防火、防盗为主要内容的安全大检查，确保重点区域如仓库、办公室用电设备等场所的安全。各部门要认真整理文件资料，将重要文件资料保管好，贵重物品存放在安全处，防止被盗。财务部门要保证保险柜等重要设施的安全稳固。保证门窗的关闭和落锁，并由该部门负责人落实到位。</p><p>　　五、在节日期间返乡的员工注意旅途人身、财物安全，假期结束后请按时回到公司上班，不得无故请假。</p><p>　　集团公司祝全体员工新春愉快，万事如意！</p><p>　　附：公司全体员工于2月9日下午整理办公区域内的环境卫生，要求做到：地面整洁，桌椅整齐，物品摆放有序。</p>', '', '', '100', '1', '2019-01-11 16:55:50', '2019-01-11 16:55:50');
INSERT INTO `yl_articles` VALUES ('6', 'SENNR-PCM 管道外防腐层状况检测仪', '9', '0', null, '<p></p><p>　SENNR一体化管道防腐层状况检测仪能在非开挖状况下对埋地管道进行检测，实现对埋地管道的外防腐层的破坏情况进行定量评估，并能对管道进行精确定位、测深，该检测技术既可作为新竣工管道的检测、验收手段，也可对正在运行的管道进行定期监测。检验埋地管道的防护层状况、有针对性的更换修补，延长管道使用寿命，可以节省大量维修改造资金。广泛适用于石油、天然气、城市燃气和自来水等防腐管道的外防腐层质量评估。&nbsp;&nbsp;<br></p>', '', 'images/7697e6813a1ebb8fc212f03c66070b1a.jpg', '100', '1', '2019-01-11 17:37:59', '2019-01-11 17:37:59');
