DROP TABLE IF EXISTS `yl_articles`;
CREATE TABLE `yl_articles` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '文章标题',
  `cateaory_id` tinyint(4) NOT NULL DEFAULT '0' COMMENT '分类id',
  `click_number` mediumint(9) DEFAULT '0' COMMENT '点击次数',
  `introduction` text COLLATE utf8mb4_unicode_ci COMMENT '简介',
  `content` longtext CHARACTER SET utf8mb4 COMMENT '文章内容',
  `enclosure` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '附件',
  `images` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '图片地址',
  `sort` mediumint(9) NOT NULL DEFAULT '100',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态 1正常 2 回收站',
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of yl_articles
-- ----------------------------

