  `title` char(6) CHARACTER SET utf8mb4 NOT NULL DEFAULT '',
  `pid` tinyint(4) NOT NULL DEFAULT '0' COMMENT '上级分类',
  `sort` tinyint(4) NOT NULL DEFAULT '100',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态 1：正常2: 删除',
  `is_top` tinyint(1) NOT NULL DEFAULT '2' COMMENT '首页 1：是 2 否',
  `is_right` tinyint(1) DEFAULT '2' COMMENT '是否展示在侧栏 1：是  2：否',
  `created_at` varchar(50) CHARACTER SET utf8mb4 DEFAULT '',
  `updated_at` varchar(50) CHARACTER SET utf8mb4 DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='文章分类';

